   };



}

handleClick =() =>{

this.setState({name:"Aditya", empId:"105"});

console.log("Button Clicked", this);

}



	render() {
		return (
			<div><h1>Hello {this.state.name} Your Emp Id is {this.state.empId}</h1>
             <button onClick = {this.handleClick}>Click Me</button>
			</div>
		);
	}
}
